-- DMR-2249 MAJ email usager
DROP TRIGGER IF EXISTS exp_aft_upd_signaleur ON signalement_signaleur;
DROP FUNCTION IF EXISTS exp_update_signaleur();

CREATE OR REPLACE function exp_update_signaleur()
 RETURNS trigger
 LANGUAGE plpgsql
AS $function$
begin
	update signalement_export set mail_usager = new.mail where id_signalement = new.fk_id_signalement;
    RETURN NEW;
END;
$function$;

create
    trigger exp_aft_upd_signaleur after update
        on
        signalement_signaleur for each row execute procedure exp_update_signaleur();

-- MAJ des tables unittree
-- Création d'une fonction permettant de mettre à jour les associations unit-sector
CREATE or replace FUNCTION update_unit_sector() 
	RETURNS void AS $$
	DECLARE
		countUnitRest integer := 1;
	begin
		select count(1) into countUnitRest from unittree_unit tuu left join unittree_unit_sector tuus on tuu.id_unit = tuus.id_unit where tuus.id_unit is null and id_parent = 0;
		if countUnitRest > 0 then
  			INSERT INTO unittree_unit_sector 
			select tuu.id_unit, tus.id_sector from unittree_unit tuu, unittree_sector tus where tuu.id_parent = 0 and tuu.id_unit = tus.id_sector ;
		end if;
	
		select count(1) into countUnitRest from unittree_unit tuu left join unittree_unit_sector tuus on tuu.id_unit = tuus.id_unit where tuus.id_unit is null;
		
		 -- Insert unit_sector until all unit is in
		 WHILE countUnitRest > 0 loop
		 	-- insert
		 	INSERT INTO unittree_unit_sector 
			select tuu.id_unit, tuus.id_sector
			from unittree_unit tuu ,unittree_unit_sector tuus
			where tuu.id_parent <> -1 and tuu.id_parent <> 0 
			and tuu.id_parent = tuus.id_unit
			and not exists (select 1 from unittree_unit_sector tuus1 where tuus1.id_unit = tuu.id_unit);
		
			-- count if unit left
			select count(1) into countUnitRest from unittree_unit tuu left join unittree_unit_sector tuus on tuu.id_unit = tuus.id_unit where tuus.id_unit is null;
		 END LOOP;
	END;
$$ LANGUAGE plpgsql;

